`,paraId:51,tocIndex:7},{value:"1.6.1.\u3010\u63A8\u8350\u3011\u5728\u6587\u4EF6\u672B\u5C3E\u4FDD\u7559\u4E00\u884C\u7A7A\u884C\u3002",paraId:52,tocIndex:8},{value:"eslint",paraId:52,tocIndex:8},{value:": ",paraId:52,tocIndex:8},{value:"eol-last",paraId:52,tocIndex:8},{value:"\u5728\u975E\u7A7A\u6587\u4EF6\u4E2D\u4FDD\u7559\u62D6\u5C3E\u6362\u884C\u662F\u4E00\u79CD\u5E38\u89C1\u7684 ",paraId:53,tocIndex:8},{value:"UNIX",paraId:53,tocIndex:8},{value:" \u98CE\u683C\u3002\u5B83\u7684\u597D\u5904\u540C\u8F93\u51FA\u6587\u4EF6\u5230\u7EC8\u7AEF\u4E00\u6837\uFF0C\u65B9\u4FBF\u5728\u4E32\u8054\u548C\u8FFD\u52A0\u6587\u4EF6\u65F6\u4E0D\u4F1A\u6253\u65AD ",paraId:53,tocIndex:8},{value:"shell",paraId:53,tocIndex:8},{value:" \u7684\u63D0\u793A\u3002",paraId:53,tocIndex:8},{value:"\u6211\u4EEC\u7EDF\u4E00\u5728\u6587\u4EF6\u672B\u5C3E\u4FDD\u7559\u4E00\u884C\u7A7A\u884C\uFF0C\u5373\u7528\u4E00\u4E2A\u6362\u884C\u7B26\u7ED3\u675F\u6587\u4EF6\uFF1A",paraId:54,tocIndex:8},{value:`// bad - \u6587\u4EF6\u672B\u5C3E\u672A\u4FDD\u7559\u6362\u884C\u7B26
