`,paraId:74,tocIndex:11},{value:"2.1.2.\u3010\u5F3A\u5236\u3011\u6B63\u786E\u5730\u4F7F\u7528 ",paraId:75,tocIndex:11},{value:"const",paraId:75,tocIndex:11},{value:" \u548C ",paraId:75,tocIndex:11},{value:"let",paraId:75,tocIndex:11},{value:"\u3002",paraId:75,tocIndex:11},{value:"eslint",paraId:75,tocIndex:11},{value:": ",paraId:75,tocIndex:11},{value:"prefer-const",paraId:75,tocIndex:11},{value:"\u58F0\u660E\u53D8\u91CF\u65F6\uFF0C\u5E94\u4F18\u5148\u4F7F\u7528 ",paraId:76,tocIndex:11},{value:"const",paraId:76,tocIndex:11},{value:"\uFF0C\u53EA\u6709\u5F53\u53D8\u91CF\u4F1A\u88AB\u91CD\u65B0\u8D4B\u503C\u65F6\u624D\u4F7F\u7528 ",paraId:76,tocIndex:11},{value:"let",paraId:76,tocIndex:11},{value:"\uFF1A",paraId:76,tocIndex:11},{value:`// bad - \u58F0\u660E\u540E\u672A\u53D1\u751F\u91CD\u65B0\u8D4B\u503C\uFF0C\u5E94\u4F7F\u7528 const
