if (flag) {
  console.log(flag);
}

// good - \u58F0\u660E\u540E\u53D1\u751F\u91CD\u65B0\u8D4B\u503C\uFF0Clet \u4F7F\u7528\u6B63\u786E
let flag = true;
if (flag) {
  flag = false;
}
`,paraId:77,tocIndex:11},{value:"\u9700\u6CE8\u610F\uFF0C\u6570\u7EC4\u548C\u5BF9\u8C61\u662F\u4E00\u4E2A\u5F15\u7528\uFF0C\u5BF9\u6570\u7EC4\u67D0\u9879\u548C\u5BF9\u8C61\u67D0\u5C5E\u6027\u7684\u4FEE\u6539\u5E76\u4E0D\u662F\u91CD\u65B0\u8D4B\u503C\uFF0C\u56E0\u6B64\u591A\u6570\u60C5\u51B5\u4E0B\u5E94\u7528 ",paraId:78,tocIndex:11},{value:"const",paraId:78,tocIndex:11},{value:" \u58F0\u660E\uFF1A",paraId:78,tocIndex:11},{value:`// bad
let arr = [];
let obj = {};
arr[0] = 'foo';
obj.name = 'bar';

// good
const arr = [];
const obj = {};
arr.push('foo');
obj.name = 'bar';
`,paraId:79,tocIndex:11},{value:"2.1.3.\u3010\u5F3A\u5236\u3011\u4E00\u6761\u58F0\u660E\u8BED\u53E5\u58F0\u660E\u4E00\u4E2A\u53D8\u91CF\u3002",paraId:80,tocIndex:11},{value:"eslint",paraId:80,tocIndex:11},{value:": ",paraId:80,tocIndex:11},{value:"one-var",paraId:80,tocIndex:11},{value:"\u8FD9\u6837\u505A\u66F4\u6613\u4E8E\u8FFD\u52A0\u65B0\u7684\u58F0\u660E\u8BED\u53E5\uFF08\u4F60\u4E0D\u9700\u8981\u603B\u53BB\u628A\u6700\u540E\u7684 ",paraId:81,tocIndex:11},{value:";",paraId:81,tocIndex:11},{value:" \u6539\u6210 ",paraId:81,tocIndex:11},{value:",",paraId:81,tocIndex:11},{value:" \u4E86\uFF09\uFF0C\u4E5F\u66F4\u6613\u4E8E\u8FDB\u884C\u5355\u6B65\u8C03\u8BD5\u3002",paraId:81,tocIndex:11},{value:`// bad
const foo = 1,
  bar = 2;

// good
