const bar = 2;
`,paraId:82,tocIndex:11},{value:"2.1.4.\u3010\u5F3A\u5236\u3011\u58F0\u660E\u7684\u53D8\u91CF\u5FC5\u987B\u88AB\u4F7F\u7528\u3002",paraId:83,tocIndex:11},{value:"eslint",paraId:83,tocIndex:11},{value:": ",paraId:83,tocIndex:11},{value:"no-unused-vars",paraId:83,tocIndex:11},{value:"\u58F0\u660E\u800C\u672A\u4F7F\u7528\u7684\u53D8\u91CF\u3001\u8868\u8FBE\u5F0F\u53EF\u80FD\u5E26\u6765\u6F5C\u5728\u7684\u95EE\u9898\uFF0C\u4E5F\u4F1A\u7ED9\u7EF4\u62A4\u8005\u9020\u6210\u56F0\u6270\uFF0C\u5E94\u5C06\u5B83\u4EEC\u5220\u9664\u3002",paraId:84,tocIndex:11},{value:`// bad - \u672A\u4F7F\u7528\u53D8\u91CF foo
const foo = 1;

// good
const foo = 1;
doSomethingWith(foo);

// bad - \u53EA\u4FEE\u6539\u53D8\u91CF\u4E0D\u8BA4\u4E3A\u662F\u88AB\u4F7F\u7528
