bar = 2;
bar += 1;

// good
let bar = 1;
bar = 2;
bar += 1;
doSomethingWith(bar);

// bad - \u672A\u4F7F\u7528\u53C2\u6570 y
function getX(x, y) {
  return x;
}

// good
function getXPlusY(x, y) {
  return x + y;
}
`,paraId:85,tocIndex:11},{value:"2.1.5.\u3010\u5F3A\u5236\u3011\u4E0D\u8981\u5728\u58F0\u660E\u524D\u5C31\u4F7F\u7528\u53D8\u91CF\u3002",paraId:86,tocIndex:11},{value:"eslint",paraId:86,tocIndex:11},{value:": ",paraId:86,tocIndex:11},{value:"no-use-before-define",paraId:86,tocIndex:11},{value:"\u5728 ",paraId:87,tocIndex:11},{value:"ES5",paraId:87,tocIndex:11},{value:" \u4E2D\uFF0C\u7531\u4E8E ",paraId:87,tocIndex:11},{value:"var",paraId:87,tocIndex:11},{value:" \u7684\u58F0\u660E\u63D0\u5347\u4F5C\u7528\uFF0C\u53D8\u91CF\u53EF\u4EE5\u5728\u58F0\u660E\u524D\u4F7F\u7528\uFF0C\u4F46\u8FD9\u6837\u505A\u53EF\u80FD\u7ED9\u4EBA\u5E26\u6765\u7591\u60D1\u548C\u9690\u60A3\uFF0C\u6240\u4EE5\u4E0D\u8981\u5728\u58F0\u660E\u524D\u5C31\u4F7F\u7528\u53D8\u91CF\uFF1A",paraId:87,tocIndex:11},{value:`// bad
console.log(foo); // => undefined
var foo = 'foo';

// good
