console.log(foo); // => foo
`,paraId:88,tocIndex:11},{value:"\u5728 ",paraId:89,tocIndex:11},{value:"ES6",paraId:89,tocIndex:11},{value:" \u4E2D\uFF0C\u7531\u4E8E ",paraId:89,tocIndex:11},{value:"const",paraId:89,tocIndex:11},{value:" \u548C ",paraId:89,tocIndex:11},{value:"let",paraId:89,tocIndex:11},{value:" \u6CA1\u6709\u58F0\u660E\u63D0\u5347\u4F5C\u7528\uFF0C\u5982\u679C\u5728\u58F0\u660E\u524D\u5C31\u4F7F\u7528\u53D8\u91CF\uFF0C\u4F1A\u76F4\u63A5\u62A5\u9519\uFF1A",paraId:89,tocIndex:11},{value:`// bad
