function getData(id) {
  const data = fetchData(id);

  if (!checkUserPermission()) {
    return false;
  }

  if (data.foo === 'bar') {
    // ...
  }

  return data;
}

// good
function getData(id) {
  if (!checkUserPermission()) {
    return false;
  }

  const data = fetchData(id);

  if (data.foo === 'bar') {
    // ...
  }

  return data;
}
`,paraId:94,tocIndex:11},{value:"2.1.7.\u3010\u5F3A\u5236\u3011\u53D8\u91CF\u4E0D\u8981\u4E0E\u5916\u5C42\u4F5C\u7528\u57DF\u5DF2\u5B58\u5728\u7684\u53D8\u91CF\u540C\u540D\u3002",paraId:95,tocIndex:11},{value:"eslint",paraId:95,tocIndex:11},{value:": ",paraId:95,tocIndex:11},{value:"no-shadow",paraId:95,tocIndex:11},{value:"\u5982\u679C\u53D8\u91CF\u4E0E\u5916\u5C42\u5DF2\u5B58\u5728\u53D8\u91CF\u540C\u540D\uFF0C\u4F1A\u964D\u4F4E\u53EF\u8BFB\u6027\uFF0C\u4E5F\u4F1A\u5BFC\u81F4\u5185\u5C42\u4F5C\u7528\u57DF\u65E0\u6CD5\u8BFB\u53D6\u5916\u5C42\u4F5C\u7528\u57DF\u7684\u540C\u540D\u53D8\u91CF\u3002",paraId:96,tocIndex:11},{value:`// bad
