`,paraId:97,tocIndex:11},{value:"2.1.8.\u3010\u5F3A\u5236\u3011\u4E0D\u8981\u91CD\u590D\u58F0\u660E\u53D8\u91CF\u548C\u51FD\u6570\u3002",paraId:98,tocIndex:11},{value:"eslint",paraId:98,tocIndex:11},{value:": ",paraId:98,tocIndex:11},{value:"no-redeclare",paraId:98,tocIndex:11},{value:"\u5728 ",paraId:99,tocIndex:11},{value:"ES5",paraId:99,tocIndex:11},{value:" \u4E2D\uFF0C\u5C3D\u7BA1\u4F7F\u7528 ",paraId:99,tocIndex:11},{value:"var",paraId:99,tocIndex:11},{value:" \u91CD\u590D\u58F0\u660E\u4E0D\u4F1A\u62A5\u9519\uFF0C\u4F46\u8FD9\u6837\u505A\u4F1A\u4EE4\u4EBA\u7591\u60D1\uFF0C\u964D\u4F4E\u7A0B\u5E8F\u7684\u53EF\u7EF4\u62A4\u6027\u3002\u540C\u7406\uFF0C\u51FD\u6570\u7684\u58F0\u660E\u4E5F\u4E0D\u8981\u4E0E\u5DF2\u5B58\u5728\u7684\u53D8\u91CF\u548C\u51FD\u6570\u91CD\u540D\uFF1A",paraId:99,tocIndex:11},{value:`// bad
var a = 'foo';
var a = 'bar';
function a() {}
console.log(a); // => 'bar'

// good
var a = 'foo';
var b = 'bar';
function c() {}
console.log(a); // => 'foo'

// bad - arg \u5DF2\u4F5C\u4E3A\u51FD\u6570\u53C2\u6570\u58F0\u660E
function myFunc(arg) {
  var arg = 'foo';
  console.log(arg);
}
myFunc('bar'); // => 'foo'

// good
function myFunc(arg) {
  var otherName = 'foo';
  console.log(arg);
}
myFunc('bar'); // => 'bar'
`,paraId:100,tocIndex:11},{value:"\u5728 ",paraId:101,tocIndex:11},{value:"ES6",paraId:101,tocIndex:11},{value:" \u4E2D\uFF0C\u4F7F\u7528 ",paraId:101,tocIndex:11},{value:"const",paraId:101,tocIndex:11},{value:" \u6216 ",paraId:101,tocIndex:11},{value:"let",paraId:101,tocIndex:11},{value:" \u91CD\u590D\u58F0\u660E\u53D8\u91CF\u4F1A\u76F4\u63A5\u62A5\u9519\uFF1A",paraId:101,tocIndex:11},{value:`// bad
const a = 'foo';
function a() {} // => Uncaught SyntaxError: Identifier 'a' has already been declared

// good
const a = 'foo';
function b() {}

// bad - arg \u5DF2\u4F5C\u4E3A\u51FD\u6570\u53C2\u6570\u58F0\u660E
function myFunc(arg) {
  const arg = 'foo';
  console.log(arg);
}
myFunc('bar'); // => Uncaught SyntaxError: Identifier 'arg' has already been declared

// good
function myFunc(arg) {
  const otherName = 'foo';
  console.log(arg);
}
myFunc('bar'); // => 'bar'
`,paraId:102,tocIndex:11},{value:"2.1.9.\u3010\u5F3A\u5236\u3011\u7981\u6B62\u8FDE\u7EED\u8D4B\u503C\u3002",paraId:103,tocIndex:11},{value:"eslint",paraId:103,tocIndex:11},{value:": ",paraId:103,tocIndex:11},{value:"no-multi-assign",paraId:103,tocIndex:11},{value:"\u53D8\u91CF\u7684\u8FDE\u7EED\u8D4B\u503C\u8BA9\u4EBA\u96BE\u4EE5\u9605\u8BFB\u548C\u7406\u89E3\uFF0C\u5E76\u4E14\u53EF\u80FD\u5BFC\u81F4\u610F\u60F3\u4E0D\u5230\u7684\u7ED3\u679C\uFF08\u5982\u4EA7\u751F\u5168\u5C40\u53D8\u91CF\uFF09\u3002",paraId:104,tocIndex:11},{value:`// bad - \u672C\u4F8B\u7684\u7ED3\u679C\u662F let \u4EC5\u5BF9 a \u8D77\u5230\u4E86\u9884\u60F3\u6548\u679C\uFF0Cb \u548C c \u90FD\u6210\u4E86\u5168\u5C40\u53D8\u91CF
(function test() {
  let a = (b = c = 1); // \u76F8\u5F53\u4E8E let a = (b = (c = 1));
})();

console.log(a); // throws ReferenceError
console.log(b); // 1
console.log(c); // 1

// good
(function test() {
  let a = 1;
  let b = a;
  let c = a;
})();

console.log(a); // throws ReferenceError
console.log(b); // throws ReferenceError
console.log(c); // throws ReferenceError
`,paraId:105,tocIndex:11},{value:"2.1.10.\u3010\u53C2\u8003\u3011\u5C06 ",paraId:106,tocIndex:11},{value:"let",paraId:106,tocIndex:11},{value:" \u548C ",paraId:106,tocIndex:11},{value:"const",paraId:106,tocIndex:11},{value:" \u5206\u522B\u5F52\u7C7B\u3002",paraId:106,tocIndex:11},{value:"\u5C06 ",paraId:107,tocIndex:11},{value:"let",paraId:107,tocIndex:11},{value:" \u548C ",paraId:107,tocIndex:11},{value:"const",paraId:107,tocIndex:11},{value:" \u5F52\u7C7B\u5199\u5728\u4E00\u8D77\uFF0C\u53EF\u4EE5\u63D0\u9AD8\u4EE3\u7801\u6574\u6D01\u6027\u3002\u6B64\u5916\uFF0C\u5982\u679C\u4F60\u60F3\u6309\u53D8\u91CF\u7684\u542B\u4E49\u6392\u5E8F\u5206\u7EC4\u4E5F\u662F\u5141\u8BB8\u7684\u3002",paraId:107,tocIndex:11},{value:`// bad
