`,paraId:125,tocIndex:12},{value:"2.2.4.\u3010\u5F3A\u5236\u3011\u907F\u514D\u4E0D\u5FC5\u8981\u7684\u5E03\u5C14\u7C7B\u578B\u8F6C\u6362\u3002",paraId:126,tocIndex:12},{value:"eslint",paraId:126,tocIndex:12},{value:": ",paraId:126,tocIndex:12},{value:"no-extra-boolean-cast",paraId:126,tocIndex:12},{value:"\u5728 ",paraId:127,tocIndex:12},{value:"if",paraId:127,tocIndex:12},{value:" \u7B49\u6761\u4EF6\u8BED\u53E5\u4E2D\uFF0C\u5C06\u8868\u8FBE\u5F0F\u7684\u7ED3\u679C\u5F3A\u5236\u8F6C\u6362\u6210\u5E03\u5C14\u503C\u662F\u591A\u4F59\u7684\uFF1A",paraId:127,tocIndex:12},{value:`// bad
