`,paraId:128,tocIndex:12},{value:"2.2.5.1.\u3010\u5F3A\u5236\u3011\u5B57\u7B26\u4E32\u4F18\u5148\u4F7F\u7528\u5355\u5F15\u53F7\u3002",paraId:129,tocIndex:13},{value:"eslint",paraId:129,tocIndex:13},{value:": ",paraId:129,tocIndex:13},{value:"quotes",paraId:129,tocIndex:13},{value:`// bad
