`,paraId:130,tocIndex:13},{value:"2.2.5.2.\u3010\u63A8\u8350\u3011\u4F7F\u7528\u6A21\u677F\u5B57\u7B26\u4E32\u66FF\u4EE3\u5B57\u7B26\u4E32\u62FC\u63A5\u3002eslint: ",paraId:131,tocIndex:13},{value:"prefer-template",paraId:131,tocIndex:13},{value:"\u6A21\u677F\u5B57\u7B26\u4E32\u8BA9\u4EE3\u7801\u66F4\u7B80\u6D01\uFF0C\u53EF\u8BFB\u6027\u66F4\u5F3A",paraId:132,tocIndex:13},{value:`// bad
