`,paraId:270,tocIndex:18},{value:"2.7.2.\u3010\u5F3A\u5236\u3011\u4E0D\u8981\u7528\u591A\u4E2A ",paraId:271,tocIndex:18},{value:"import",paraId:271,tocIndex:18},{value:" \u5F15\u5165\u540C\u4E00\u6A21\u5757\u3002",paraId:271,tocIndex:18},{value:"eslint",paraId:271,tocIndex:18},{value:": ",paraId:271,tocIndex:18},{value:"import/no-duplicates",paraId:271,tocIndex:18},{value:"\u591A\u6761 ",paraId:272,tocIndex:18},{value:"import",paraId:272,tocIndex:18},{value:" \u8BED\u53E5\u5F15\u5165\u4E86\u540C\u4E00\u6A21\u5757\u4F1A\u964D\u4F4E\u53EF\u7EF4\u62A4\u6027\uFF0C\u4F60\u9700\u8981\u5C06\u5B83\u4EEC\u5408\u6210\u4E00\u6761\u8BED\u53E5\u3002",paraId:272,tocIndex:18},{value:`// bad
import React from 'react';
import { Component } from 'react';

// good
