`,paraId:273,tocIndex:18},{value:"2.7.3.\u3010\u5F3A\u5236\u3011import \u8BED\u53E5\u9700\u8981\u653E\u5230\u6A21\u5757\u7684\u6700\u4E0A\u65B9\u3002",paraId:274,tocIndex:18},{value:"eslint",paraId:274,tocIndex:18},{value:": ",paraId:274,tocIndex:18},{value:"import/first",paraId:274,tocIndex:18},{value:"\u7531\u4E8E ",paraId:275,tocIndex:18},{value:"import",paraId:275,tocIndex:18},{value:" \u8BED\u53E5\u4F1A\u88AB\u58F0\u660E\u63D0\u5347\uFF0C\u5C06\u5B83\u4EEC\u653E\u5230\u6A21\u5757\u7684\u6700\u4E0A\u65B9\u4EE5\u9632\u6B62\u5F02\u5E38\u884C\u4E3A\u3002",paraId:275,tocIndex:18},{value:`// bad
