`,paraId:307,tocIndex:19},{value:"2.8.4.\u3010\u5F3A\u5236\u3011\u907F\u514D\u5D4C\u5957\u7684\u4E09\u5143\u8868\u8FBE\u5F0F\u3002",paraId:308,tocIndex:19},{value:"eslint",paraId:308,tocIndex:19},{value:": ",paraId:308,tocIndex:19},{value:"no-nested-ternary",paraId:308,tocIndex:19},{value:"\u5D4C\u5957\u7684\u4E09\u5143\u8868\u8FBE\u5F0F\u4F1A\u964D\u4F4E\u4EE3\u7801\u53EF\u8BFB\u6027\u3002",paraId:309,tocIndex:19},{value:`// bad
