`,paraId:310,tocIndex:19},{value:"2.8.5.\u3010\u5F3A\u5236\u3011\u907F\u514D\u4E0D\u5FC5\u8981\u7684\u4E09\u5143\u8868\u8FBE\u5F0F\u3002",paraId:311,tocIndex:19},{value:"eslint",paraId:311,tocIndex:19},{value:": ",paraId:311,tocIndex:19},{value:"no-unneeded-ternary",paraId:311,tocIndex:19},{value:`// bad
