const foo = (a && b < 0) || c > 0 || d + 1 === 0;

// good
const foo = (a && b < 0) || c > 0 || d + 1 === 0;

// bad
const bar = a ** b - (5 % d);

// good
const bar = a ** b - (5 % d);

// bad - \u6709\u4EBA\u53EF\u80FD\u4F1A\u8BEF\u4EE5\u4E3A\u6267\u884C\u987A\u5E8F\u662F (a || b) && c
if (a || (b && c)) {
  return d;
}

// good
