let foo;
switch (bar) {
  case 1:
    foo = 2;
    break;
}

// good
let foo;
switch (bar) {
  case 1:
    foo = 2;
    break;
  default:
    foo = 0;
}

// good - \u5982\u679C\u6709\u610F\u7701\u7565 default\uFF0C\u8BF7\u5728 switch \u8BED\u53E5\u672B\u5C3E\u7528 \`// no default\` \u6CE8\u91CA\u6307\u660E
