`,paraId:8,tocIndex:1},{value:"1.4.\u3010\u63A8\u8350\u3011\u629B\u51FA\u5F02\u5E38\u65F6\uFF0C\u4F7F\u7528\u539F\u751F ",paraId:9,tocIndex:1},{value:"Error",paraId:9,tocIndex:1},{value:" \u5BF9\u8C61\u3002",paraId:9,tocIndex:1},{value:"eslint",paraId:9,tocIndex:1},{value:": ",paraId:9,tocIndex:1},{value:"no-throw-literal",paraId:9,tocIndex:1},{value:`// bad
